const Login = () => {
    return (
        <div className="login">
            <div>
                <h2>Login</h2>
                <form>
                    <div class="input-wrapper">
                        <label for="username" className="input_label">Username</label>
                        <input className="input" id="username"></input>
                    </div>
                    <div>
                        <label for="password" className="input_label">Password</label>
                        <input className="input" id="password"></input>
                    </div>
                </form>
            </div>
        </div>
    )
};

export default Login;
